import React from 'react';
import { Tabs, Tab } from '@mui/material';

const EverythingView = () => {
  return (
    <div>
      <Tabs>
        <Tab label="Tab 1" />
        <Tab label="Tab 2" />
      </Tabs>
    </div>
  );
};

export default EverythingView;
